import React from "react";

export const Registration_BusinessPage = () => {

    const Field_Dispenser = (type,name,id,value) => {

        return <React.Fragment>

        <div
        style={{
            width: 'inherit',

            display:'flex',
            flexDirection:'column',
            justifyContent:'space-around',

            fontFamily: '큐트신민상',
            fontSize: '7vw',

            letterSpacing: '1vw',
            margin: '2vh 0vw'

        }}
        >

            <label htmlFor={id}
            style={{

            }}
            >
            {name.toUpperCase()}
            </label>
            
            <input 
            type={type}
            name={name}
            id={id}
            value={value}
            style={{
                width:'inherit',
                margin: '1vh 0vw 1vh 5vw',
                borderRadius: '7px',

            }}

            ></input>

        </div>

        </React.Fragment>

    }

    return <React.Fragment>
            <div
            style={{
            width:'inherit',
            height:'inherit',
            
            display:'flex',
            flexDirection:'column',

            justifyContent:'center',
            alignItems: 'center'
            }}
            >

                <span>Registration</span>

                <div
                style={{
                    Width: '70vw',
                    backgroundColor: 'white',
                    padding: '6vh 10vw',
                    borderRadius: '15px',
                    border: 'black solid 1.5px'
                }}
                >

                    <div>
                        
                        {Field_Dispenser('text','name','name')}

                        {Field_Dispenser('email','email','email')}

                        {Field_Dispenser('text', 'ID', 'ID')}

                        {Field_Dispenser('text','PASSWORD','PASSWORD')}

                        {Field_Dispenser('text', 'position', 'position', 'business')}

                    </div>

                </div>

            </div>

        </React.Fragment>
    

}

export default Registration_BusinessPage
